  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey (USGS) mapped
  approximately 336 square kilometers of the lower shoreface and inner-continental
  shelf offshore of Fire Island, New York in 2011 using interferometric sonar and
  high-resolution chirp seismic-reflection systems. This report presents maps of bathymetry,
  acoustic backscatter, the coastal plain unconformity, the Holocene marine transgressive
  surface and modern sediment thickness. These spatial data support research on the
  Quaternary evolution of the Fire Island coastal system and provide baseline information
  for research on coastal processes along southern Long Island. More information about
  this field activity and the data collected can be found at the Field Activity Web
  Page (http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2011-005-FA)\",\n\t\"license_title\":
